      {
        key: i,
        type: "user",
        data: changeUser(container.resources[0].data.lines)
      },
      {
        key: i,
        type: "line",
        data: ""
        // data: changeItem(container.resources[0].data.lines.line[0].dirn.pattern)
      },
      {
        key: i,
        type: "mask",
        data: ""
        // data: changeItem(container.resources[0].data.lines.line[0].e164Mask)
      },
      {
        key: i,
        type: "ip",
        data: changeName(container.resources[0].data.ip_address)
      },
      {
        key: i,
        type: "location",
        data: container.resources[0].meta.hierarchy.split("_").pop().toLowerCase()
      }
    ]);
  });

  lasPhones['devices'].forEach(device => {
    searchDevice.push([
      {
        key: i,
        type: "mac",
        data: device.mac
      },
      {
        key: i,
        type: "user",
        data: device.user
      },
